import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';

function TestAnimation(){
    return (
        <motion.div
            style={{ x: 0 }} animate={{ x: 100 }}
        >
            Test Animation

        </motion.div>
    )

}

export default TestAnimation;
